import React from 'react';

export default function TablePreview({ previewData, onClassify, onBack }) {
  // If no data, show a simple message
  if (!previewData || previewData.length === 0) {
    return (
      <div className="selector">
        <h3>No data to preview</h3>
        <button onClick={onBack}>Back</button>
      </div>
    );
  }

  // Grab the raw SQL column names: ['col1','col2',…]
  const columns = Object.keys(previewData[0]);

  return (
    <div className="selector">
      <h3>Table Preview</h3>
      <button onClick={onBack}>Back</button>

      <div style={{ overflowX: 'auto', marginTop: 16 }}>
        <table>
          <thead>
            <tr>
              {columns.map((col) => (
                <th key={col}>{col}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {previewData.map((row, rowIdx) => (
              <tr key={rowIdx}>
                {columns.map((col) => (
                  <td key={col}>{row[col]}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <button
        onClick={onClassify}
        disabled={previewData.length === 0}
        style={{ marginTop: 12 }}
      >
        Classify Columns
      </button>
    </div>
  );
}
